function createTooltip(content) {
  console.log('rfhisnvsdr');
  const tooltip = document.createElement('div');
  tooltip.textContent = content;
  // tooltip.style.width = '500px';
  // tooltip.style.height = '500px';
  tooltip.style.position = 'absolute';
  tooltip.style.background = 'pink';
  tooltip.style.padding = '8px';
  tooltip.style.border = '1px solid #ccc';
  console.log(tooltip);
  return tooltip;
}
  console.log(state_data)
function handleMouseEnter(event,hoverStateId) {
  
  const path = document.getElementById(hoverStateId);
  
  if (path) {
    path.style.fill = '#ffcc00'; //This will change color on hover
    for (let i = 0; i < state_data.length; i++) {
      if (state_data[i].state === hoverStateId) {
        // Match found, you can access the properties
        const matchedObject = state_data[i];
        // console.log("Match found for state: ", hoverStateId);
        // console.log("Store Counts: ", matchedObject.store_counts);
      
        const tooltip = createTooltip(`${hoverStateId} has ${matchedObject.store_counts} number of stores`);
          
        // const offsetX = 10; // Adjust as desired
        // const offsetY = 4000; // Adjust as desired
        const stateRect = path.getBoundingClientRect();
        const containerRect = document.getElementById('header-hero').getBoundingClientRect();
        const offsetX = 10; 
        const offsetY = 20; 
          // tooltip.style.top = ${containerRect.top + event.clientY + offsetY}px;
          // tooltip.style.left = ${containerRect.left + event.clientX + offsetX}px;
        tooltip.style.top = `${stateRect.top - containerRect.top + offsetY}px`;
        tooltip.style.left = `${stateRect.left - containerRect.left + offsetX}px`;
        tooltip.id = `tooltip-${hoverStateId}`;
        document.body.appendChild(tooltip);

        break;
      }
    }
  }
}

function handleMouseLeave(event,hoverStateId) {
  const path = document.getElementById(hoverStateId);
  // if (path) {
  //     path.style.fill = '#000000'; // again will change color to black
  //     const tooltips = document.querySelectorAll('.tooltip');
  //     tooltips.forEach((tooltip) => tooltip.remove());
  // }
  if (path) {
    console.log(`tooltip-${hoverStateId}`)
    path.style.fill = '#3194db'; // again will change color to black
    const tooltip = document.getElementById(`tooltip-${hoverStateId}`);
    if (tooltip) {
      document.body.removeChild(tooltip);
    } 
  }
}

document.addEventListener('DOMContentLoaded', () => {
  const svg = document.createElementNS('http://www.w3.org/2000/svg', 'svg');
  svg.setAttribute('version', '1.1');
  svg.setAttribute('id', 'svg2');
  svg.setAttribute('x', '0px');
  svg.setAttribute('y', '0px');
  svg.setAttribute('viewBox', '-114 -50.4 611.9 695.7');

  stateCodes.forEach((stateCode) => {
    const path = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    path.setAttribute('id', stateCode);
    path.setAttribute('d', drawPath[stateCode]); 
    path.style.fill='#3194db';
    path.addEventListener('click', () => {
      console.log(`Clicked on ${stateCode}`);
    });
    path.addEventListener('mouseenter', (event) => handleMouseEnter(event,stateCode));
    path.addEventListener('mouseleave', (event) => handleMouseLeave(event,stateCode));
    svg.appendChild(path);
    });

  document.getElementById('map-container').appendChild(svg);
});
